import React from "react";
import './Form.css'

function Form(props) {

    const toggleForm = event => {
        props.setActiveForm(props.form)
        console.log('active: ' + props.activeForm.key);
        console.log('this :' + props.form.key);
    }

    return ( 
        <div className="form">
            <button id={props.form.key} onClick={toggleForm} >{props.form.title}</button>
            {props.activeForm.key===props.form.key ? props.form.content : ''}
            
        </div>
     );
}

export default Form;
